import './App.css';
import LandingView from './pages/landing.view/landing.view';
import PostcardView from './pages/postcardview/postcardview';
import PostView from './pages/postview/postview';
import PostForm from './pages/postform/postform.view';

import { LANDING, POSTCARD, POST, POSTFORM } from './routes/routes';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">

       <Router>
      <div>

        <Switch>
          <Route exact path={LANDING}>
            <LandingView />
          </Route>
          <Route exact path={POSTCARD}>
            <PostcardView />
          </Route>
          <Route exact path={POST}>
            <PostView />
            </Route>
            <Route exact path={POSTFORM}>
            <PostForm />
          </Route>
        </Switch>
      </div>
    </Router>
    </div>
  );
}

export default App;
